import axios from "axios";

export function fetchUserDetails (accountNumber){
    axios.get(`http://localhost:8080/details?accountNumber=${accountNumber}`)
        .then(function (response) {
            // console.log(response);
            var balance=response.data.balance;
           return balance;

        })
        .catch(function (error) {
            console.log(error);
            return error;
        });
 }
